import React, { Component } from "react";

class Dashboard extends Component {
  state = {};
  render() {
    return (
      <React.Fragment>
        <main className="container">
          <div>
            <h2>DashBoard</h2>
            <p>Showing number of bookings</p>
            <table className="table">
              <thead>
                <tr>
                  <th>Name</th>
                  <th>Phone Number</th>
                  <th>Service</th>
                  <th>Delete</th>
                </tr>
              </thead>
              <tbody>
                <td></td>
                <td></td>
                <td></td>
                <td></td>
              </tbody>
            </table>
          </div>
        </main>
      </React.Fragment>
    );
  }
}

export default Dashboard;
